export const generateFakeTableData = ({
    count = 24,
    base = 5,
    range = 3, 
    intervalMin = 60
} = {}) => {
    const rows = [];
    const now = Date.now();

    for(let i = 0; i < count; i ++){
        const min = +(base - Math.random()).toFixed(2);
        const max = +(base + range + Math.random()).toFixed(2);
        const value = +(Math.random()  * (max - min) + min).toFixed(2);
        const rate = +((value/max))
    }
}
